import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { useSignOut } from 'react-auth-kit';
import { useNavigate } from 'react-router-dom';
import { useIsAuthenticated } from 'react-auth-kit';
import $ from 'jquery';
import './Styles/Navbar.css';

function Navbar() {

    const isAuthenticated = useIsAuthenticated();
    const signOut = useSignOut();
    const navigate = useNavigate();
    const [loggedIn, setLoggedIn] = useState(false);
    const [mobileMenu, setMobileMenu] = useState(false);

    const logout = () => {
        signOut();
        setLoggedIn(false);
        navigate("/login");
    } 

    useEffect(() => {
        if(isAuthenticated()){
            setLoggedIn(true);
            localStorage.removeItem("searchKey");
        } else {
            setLoggedIn(false);
            localStorage.removeItem("searchKey");
        }

    }, [isAuthenticated]);

    useEffect(()=> {
        if(window.location.pathname === "/books") {
            setTimeout(()=> {
                document.getElementById("navbar").style.paddingBottom = "90px";
                $("#search-bar").fadeIn(1000);
            }, 50);

        } else {
            setTimeout(()=> {
                document.getElementById("navbar").style.paddingBottom = "0px";
                $("#search-bar").fadeOut(50);
            }, 50);
        }

        setTimeout(()=> {
            localStorage.removeItem("searchKey");
        }, 5 * 60 * 1000);
    })

    const toggleMobileMenu = () => {
        setMobileMenu(!mobileMenu);

        setTimeout(()=> {
            document.getElementById("mobile-links").style.right = mobileMenu ? "-300px" : "-100px";
        }, 50);
    }

    return (
        <div className='nav-content'>
        <nav id='navbar'>
            <Link to='/' className='logo'>
                <i className="fa-solid fa-book-open"></i> BookQuest
            </Link>

            <div className='navbar-links'>
                <ul>
                    <li>
                        <Link className='navbutton' to='/books'>
                            Books
                        </Link>
                    </li>
                    {loggedIn && (
                        <li>
                            <Link className='navbutton' to='/mylog'>
                                My Log
                            </Link>
                        </li>
                     )}
                    {!loggedIn && (
                        <>
                            <li>
                                <Link className='navbutton' to='/login'>
                                    Login
                                </Link>
                            </li>
                            <li>
                                <Link className='navbutton' to='/signup' id='signup-button'>
                                    Sign up
                                </Link>
                            </li>
                        </>
                    )}
                    {loggedIn && (
                        <>
                            <li>
                                <Link to='/Profile' >
                                    <img id='user-icon' src={require('../assets/images/user-icon.png')} alt='user-icon' />
                                </Link>      
                            </li>
                            <li className='logoutbtn'>
                                <i className="fa-solid fa-right-from-bracket" onClick={()=> {logout()}}></i>
                            </li>   
                        </>
                    )}
                </ul>

                <div className='hamburger-icon' onClick={()=> {toggleMobileMenu()}}>
                    <i className="fa-solid fa-bars"></i>
                </div>
            </div>
        </nav>

        {mobileMenu && 
            <>
            <div id='mobile-links'>
                <ul>
                    <li>
                        <Link to='/books'>
                            Books
                        </Link>
                    </li>
                    {loggedIn && (
                        <li>
                            <Link to='/mylog'>
                                My Log
                            </Link>
                        </li>
                        )}
                    {!loggedIn && (
                        <>
                            <li>
                                <Link to='/login'>
                                    Login
                                </Link>
                            </li>
                            <li>
                                <Link to='/signup'>
                                    Sign up
                                </Link>
                            </li>
                        </>
                    )}
                    {loggedIn && (
                        <>
                            <li>
                                <Link to='/Profile' >
                                    <img id='user-icon' src={require('../assets/images/user-icon.png')} alt='user-icon' />
                                </Link>      
                            </li>
                            <li className='logoutbtn' >
                                <i className="fa-solid fa-right-from-bracket" onClick={()=> {logout()}}></i>
                            </li>   
                        </>
                    )}
                </ul>
            </div>

          <div id="m-overlay" onClick={()=> {toggleMobileMenu()}}></div> 
          </> 
        }

        </div>
    )
}

export default Navbar
